import React from 'react'
import { FlexCol, PaddingX } from '../constants/style'
import { Fade, Slide } from 'react-reveal';

export default function Header() {
  return (
    <Slide top cascade>
      <div className={`${FlexCol} bg-background relative pt-[66px] pb-[100px] pl-[102px] `}>
          <img src='../images/logo.png' className={`w-[270px] h-[62px]`}/>
          <p>여기다가</p>
      </div>
    </Slide>
  )
}
